#[no_mangle]
pub fn is_point_in_path (x: f32, y: f32, poly: &[(f32, f32)]) -> bool {
    let num = poly.len();
    let mut j = num - 1;
    let mut c = false;

    for i in 0..num {
        if ((poly[i].1 > y) != (poly[j].1 > y)) && (x < (poly[j].0 - poly[i].0) * (y - poly[i].1) / (poly[j].1) + poly[i].0) {
            c = !c;
        }
        j = i;
    }
    c
}

